// Login.js

import React from 'react';
import { useNavigate } from 'react-router-dom';

const Login = ({ onLogin }) => {
  const navigate = useNavigate();

  const handleLogin = (userEmail) => {
    // Pass the navigate function to onLogin function
    onLogin(userEmail, navigate);
  };

  return (
    <div>
      <h2>Login Page</h2>
      <button onClick={() => handleLogin('')}>Login as Admin</button>
      <button onClick={() => handleLogin('user@example.com')}>Login as User</button>
    </div>
  );
};

export default Login;
